import { Layout } from '../components/Layout';
import Link from 'next/link';
import Head from 'next/head';
const PostLink = props => (
  <li>
    <Link href={ `/post?title=${props.title}` }>
      <a>{ props.title }</a>
    </Link>
  </li>
)

const Index = () => (
  <Layout>
    <Head>
      <link type="text/css" rel="stylesheets" href="https://stackpath.bootstrapcdn.com/bootstrap/3.3.6/css/bootstrap.min.css"></link>
    </Head>
    <h1>Hello Production</h1>
    <PostLink title="POST 1"/>
    <PostLink title="POST 2"/>
    <PostLink title="POST 3"/>
  </Layout>
);

export default Index;
